import React from "react";
import RecipeReviewCard from "../../Components/Card/Card";
import { partners } from "./PartnerList";
import './Team.css'

const Team = () => {
  return (
    <div className="team-list">
      <div></div>
      {partners.map((partner) => {
        return <RecipeReviewCard partner={partner} />;
      })}
    </div>
  );
};

export default Team;
